import React  from 'react';
import { Link } from "react-router-dom";

const Detail = ({ movie }) => {
    const { params: { bookId }} = match;
    return (
        <div className="container-fluid">
            <h1> Detail Movie ${movie.title} </h1>
            <p>
                 ${movie.overview}
             </p>
        </div>
    );
};

export default Detail;
